import React from 'react';
import {Route} from 'react-router-dom'
import CourseRegister from './components/CourseRegister'
import OnlineProfile from "./components/OnlineProfile"
import Join from "./components/Join"
import Login from "./components/Login"
import SchoolStatus from './components/SchoolStatus';
import NumberRange from './components/NumberRange';
import Anchor from './components/Anchor';
import ImageMap from './components/ImageMap';
import Color from './components/Color';

const App = () => (<>
<Route exact path='/' component ={Join}/><br/>
<Route exact path='/' component ={Login}/><br/>
<Route component ={SchoolStatus}/><br/>
<Route component ={NumberRange}/><br/>
<Route component ={Anchor}/><br/>
<Route component ={ImageMap}/><br/>
<Route component ={Color}/><br/>
<Route component ={CourseRegister}/><br/>
<Route component ={OnlineProfile}/><br/>
</>
)
export default App;
